  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood NWR
  (including Chase Lake NWR and District VI Easement Refuges) outlines Refuge accomplishments
  from January through April of 1962. The report begins by summarizing the weather
  conditions, habitat conditions, water conditions, and food and cover during this
  period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  and collections and receipts. Resource management is outlined; topics include grazing
  and fur harvesting. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, and Refuge participation. Items of interest, N-R forms, and
  photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
